import React, { Fragment } from "react";

const BudgetCount = () => {
  return (
    <Fragment>
      <div className="alert alert-primary">Budget:</div>
      <div className="alert ">Remaining:</div>
    </Fragment>
  );
};

export default BudgetCount;
